import React from 'react'
import './home.css';
import { Component } from 'react';
import { BrowserRouter as Router, NavLink} from 'react-router-dom';

const API = 'https://api.tvmaze.com/search/shows?q=';

export default class Home extends Component {
  constructor() {
    super();
    this.state = {
      data : [],
      isLoaded: false,
      image : "NONE",
      score : 0,
      language: "NONE",
      genre: "NONE",
      status : "NONE",
    }
  }

  say_info = (name) => {

  }

  get_data = (name) => {
    fetch(API + name)
    .then(res => res.json())
    .then(json => {
      this.setState({
        isLoaded: true,
        data: json,
      })
    });
  }

  // componentDidMount = (name) => {
  //   this.get_data("teste")
  // }

  render() {
    var {isLoaded, data} = this.state;

    return (
      <div className="home">
        <form>
          <input type="text" onChange={this.get_data}></input>
        </form>
        <ul className="list">
          {data.map(item => (
            <li key={item.score}>
              <NavLink to={"/info/".concat(item.show.name)}><img src={item.show.image.medium}></img></NavLink>
            </li>
          ))};
        </ul>
      </div>
    )
  }
}
